import {makeStyles} from '@material-ui/core/styles'
const useStyles = makeStyles((theme)=>({
   box:{
      marginTop:'10vh',
      overflow:'hidden',
      height:'100vh'
   },
   maincontainer:{
      display:'flex',
      alignItems:'center',
      justifyContent:'center'
   },
   img:{
      maxWidth:'100%'
   },
   box2:{
      display:'flex',
      alignItems:'center',
      justifyContent:'center'
   }
}))


export default useStyles
